import React from 'react';
import styled from "styled-components";

const LayoutFooter = styled.footer`
    width:100%; 
    height:50px;
    background:#333; 
    color:#e3e3e3;
    .inner{
      padding:15px;
      width: 100%;
      margin: 0 auto;
    }

    @media (min-width: 992px) { 
      .inner{
          width:992px;
          padding:0;
      }
    }
    @media (min-width: 1200px) { 
      .inner{
          width:1200px;
      }
    }
`;

const BasicFooter = () => {
  return (<LayoutFooter>
  <div className="inner">

    <FooterLogo>
      UNKOWN24
    </FooterLogo>


  </div>
</LayoutFooter>)
}

export default BasicFooter;
